import { initializeApp } from "firebase/app";
import { getAuth, signOut, } from "firebase/auth";
import { useNavigate } from "react-router-dom";
import "./app.css"
function Main() {

    const navigate = useNavigate()

    const firebaseConfig = {
        apiKey: "AIzaSyClEH1wG_p4Bk7y8dl88UEi1OcSmd_7Yl4",
        authDomain: "pro-app-7adb5.firebaseapp.com",
        projectId: "pro-app-7adb5",
        storageBucket: "pro-app-7adb5.appspot.com",
        messagingSenderId: "840528707586",
        appId: "1:840528707586:web:759e54f6d5ecf02251671b",
        measurementId: "G-Q000JTLWD8"
    };

    const app = initializeApp(firebaseConfig);
    const auth = getAuth()
    const submitData = (event) => {
        event.preventDefault()


        signOut(auth)
            .then(() => {
                alert("Logout successfull")
                navigate("/Login")
            })
            .catch(() => {
                alert("error")
            })

    }

    return (




        <div className="container-fluid" id="b">
            <div className="row" style={{ boxShadow: "lightblue 8px 10px 10px 8px" ,position:"fixed"}} >
                <div className="col" >
                    <img src="https://cdn-icons-png.flaticon.com/512/146/146940.png" style={{ width: "70px", borderRadius: "20px" }}></img>
                </div>
                <div className="col" id="mob" style={{ color: "  rgb(0, 255, 89)", fontSize: "larger", opacity: "0.6" }}>
                    <b>BOOK_STALL</b>
                </div>
                <div className="col" style={{ marginTop: "20px" }}>
                    <form class="d-flex" role="search">
                        <input class="form-control me-2" type="search" placeholder="Search" id="search" style={{ width: "600px", padding: "10px", marginLeft: "40px" }}></input>
                        <button class="btn btn-outline-success" type="submit">Search</button>
                    </form>
                </div>
                <div className="col" style={{ marginTop: "15px" }}>
                    <p id="bell" style={{ marginLeft: "50px", }}><i style={{ fontSize: "30px", border: "2px solid black", borderRadius: "50% ", padding: "10px", cursor: "pointer" }} class="fa-solid fa-bell"></i></p>
                </div>
                <div className="col" style={{ marginTop: "20px" }}>

                    <form id="log" onSubmit={submitData}>
                        <button type="submit" class="btn btn-danger">Logout</button>
                    </form>

                </div>
            </div>


    <div class="row">

                <div class="col">
                  
                </div>
                <div class="col">
                    

                </div>

            </div>
   
        </div>
  
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
   
